import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import '../components/Login.css'
import '../components/BackgroundColor.css'
import { useState } from 'react';

function Login() {
  return (
    <Form className="loginbox">
      <Form.Group className="mb-3 formboxemail" controlId="formBasicEmail">
        <Form.Label>E-mail: </Form.Label>
        <Form.Control type="email" placeholder="Insira o seu e-mail" />
        <Form.Text className="text-muted">
        </Form.Text>
      </Form.Group>

      <Form.Group className="mb-3 formboxpassword" controlId="formBasicPassword">
        <Form.Label>Senha: </Form.Label>
        <Form.Control type="password" placeholder="Insira a sua senha" />
      </Form.Group>
      <Button className="loginbutton" variant="primary" type="submit">
        ENTRAR
      </Button>
    </Form>
  );
}

export default Login;
